import { Col, Card, Container, Row } from "react-bootstrap";
import Ratings from "./Ratings";
function Testimonials() {
return (
    <Container fluid>
    <Row>
    <Col>
    <Ratings header="header" title="title" image={null} text="this is text"/>
    </Col>
    </Row>
    </Container>
);
};

export default Testimonials;
